import { Routes, Route } from "react-router-dom";
import About from "./Pages/About";
import Login from "./Pages/Login";
import Pricing from "./Pages/Pricing";
import Notfound from "./Pages/Notfound";
import Navigation from "./Components/Navigation";
import Profil from "./Pages/Profil";
import Project from "./Pages/Project";
import Freepricing from "./Pages/Freepricing";
import Premiumpricing from "./Pages/Premiumpricing";

function App() {
  return (
    <div className="App">
      <Navigation />
      <Routes>
        <Route path="*" element={<Notfound />}></Route>
        <Route path="/about" element={<About />} />
        <Route path="/login" element={<Login />} />
        <Route path="/user/:userId" element={<Profil />} />
        <Route path="/user/:userId/:projectId" element={<Project />} />

        <Route path="/pricing" element={<Pricing />}>
          <Route patch="free" element={<Freepricing />} />
          <Route patch="premium" element={<Premiumpricing />} />
        </Route>
      </Routes>
    </div>
  );
}

export default App;
